import React , {Component} from 'react'

class Todolist extends Component {
    constructor() {
        super();
        this.state = {
            userInput: '',
            item: []
        }
    }
    render () {
        return (
            <div>
                <h1>Ma Tout doux liste</h1>
                <form>
                    <input 
                    value={this.state.userInput}
                    type='texte' 
                    placeholder='Choses a faire'>
                    onChange
                    </input>
                    <button>Send</button>
                </form>
            </div>
        )
    }
}

export default Todolist;
